/*Table structure for table `lote_compra` */

DROP TABLE IF EXISTS `lote_compra`;

CREATE TABLE `lote_compra` (
  `id_lote` int(11) NOT NULL AUTO_INCREMENT,
  `monto_total` varchar(15) NOT NULL,
  `nombres` varchar(50) NOT NULL,
  `email` varchar(50) NOT NULL,
  `telefono` varchar(50) NOT NULL,
  `doc_identidad` varchar(15) NOT NULL,
  `datos_env` text NOT NULL,
  `create_timestamp` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `update_timestamp` timestamp NULL DEFAULT NULL,
  `ip_address` varchar(15) DEFAULT NULL,
  `control` varchar(15) DEFAULT NULL,
  `status` varchar(10) DEFAULT 'active',
  PRIMARY KEY (`id_lote`)
) ENGINE=InnoDB AUTO_INCREMENT=824 DEFAULT CHARSET=latin1;

