/*Table structure for table `metodos` */

DROP TABLE IF EXISTS `metodos`;

CREATE TABLE `metodos` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `controller` varchar(50) NOT NULL,
  `funcion` varchar(50) NOT NULL,
  `metodo` varchar(50) NOT NULL,
  `status` varchar(50) NOT NULL DEFAULT 'active',
  `register_date` timestamp NULL DEFAULT NULL,
  `update_timestamp` timestamp NULL DEFAULT NULL,
  `description` varchar(120) DEFAULT NULL,
  PRIMARY KEY (`id`,`controller`,`funcion`,`metodo`,`status`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `metodos` */

/*Table structure for table `status_nyx` */

DROP TABLE IF EXISTS `status_nyx`;

CREATE TABLE `status_nyx` (
  `id` int(20) NOT NULL AUTO_INCREMENT,
  `control` varchar(50) DEFAULT NULL,
  `cod_afiliacion` varchar(50) DEFAULT NULL,
  `factura` varchar(50) DEFAULT NULL,
  `monto` varchar(50) DEFAULT NULL,
  `estado` varchar(5) DEFAULT NULL,
  `descripcion` varchar(50) DEFAULT NULL,
  `vtid` varchar(50) DEFAULT NULL,
  `seqnum` varchar(50) DEFAULT NULL,
  `authid` varchar(50) DEFAULT NULL,
  `authname` varchar(50) DEFAULT NULL,
  `tarjeta` varchar(50) DEFAULT NULL,
  `referencia` varchar(50) DEFAULT NULL,
  `terminal` varchar(50) DEFAULT NULL,
  `lote` varchar(50) DEFAULT NULL,
  `rifbanco` varchar(50) DEFAULT NULL,
  `afiliacion` varchar(50) DEFAULT NULL,
  `voucher` text,
  `codigo` varchar(5) DEFAULT NULL,
  `create_timestamp` varchar(50) DEFAULT NULL,
  `ip_address` varchar(50) DEFAULT NULL,
  KEY `id_lote` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=130 DEFAULT CHARSET=latin1;

