/*!50001 CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `vis_compra` AS (select `cp`.`id_lote` AS `id_lote`,`cp`.`id_producto` AS `id_producto`,`cp`.`descripcion_producto` AS `descripcion_producto`,`cp`.`cantidad_producto` AS `cantidad_producto`,`cp`.`costo_producto` AS `costo_producto`,`lt`.`status` AS `status`,`st`.`control` AS `control`,`cp`.`create_timestamp` AS `fecha`,(case `st`.`estado` when 'A' then 'Aprobada' when 'R' then 'Rechazada' when 'P' then 'Pendiente' else `st`.`estado` end) AS `estado` from ((`lote_compra` `lt` join `compra_nyx` `cp` on((`lt`.`id_lote` = `cp`.`id_lote`))) join `status_nyx` `st` on((`st`.`factura` = `lt`.`id_lote`)))) */;

