/*View structure for view vis_lote */

/*!50001 DROP TABLE IF EXISTS `vis_lote` */;
/*!50001 DROP VIEW IF EXISTS `vis_lote` */;

/*!50001 CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `vis_lote` AS (select `l`.`id_lote` AS `num_factura`,`s`.`control` AS `num_control`,`l`.`nombres` AS `nombres`,`l`.`email` AS `email`,`l`.`telefono` AS `telefono`,`l`.`doc_identidad` AS `doc_identidad`,`l`.`datos_env` AS `datos_env`,`l`.`create_timestamp` AS `fecha`,`l`.`status` AS `status`,`l`.`monto_total` AS `monto_nyx`,`s`.`monto` AS `monto_megasoft`,(case `s`.`estado` when 'A' then 'Aprobada' when 'R' then 'Rechazada' when 'P' then 'Pendiente' else `s`.`estado` end) AS `estado_compra`,`s`.`descripcion` AS `descricion_estado`,`s`.`codigo` AS `codigo_compra`,`s`.`create_timestamp` AS `fecha_pago` from (`lote_compra` `l` join `status_nyx` `s` on((`l`.`control` = `s`.`control`)))) */;

